function str = getToolTipString(key)
% Open the TooltipString Catalog:
persistent toolTipStrings;
if isempty(toolTipStrings)
    toolTipStrings = matlab.internal.Catalog('MATLAB:uistring:figuretoolbar');
end
str = toolTipStrings.getString(key);
end

function str = getLabelString(key)
% Open the Label Catalog:
persistent labelStrings;
if isempty(labelStrings)
    labelStrings = matlab.internal.Catalog('MATLAB:uistring:uitoolfactory');
end
str = labelStrings.getString(key);
end

